import styles from "./App.module.scss";
import { NavBar } from "./components/NavBar/NavBar";
import { HomePage} from "./"

const App = () => {
  return (
    <>
    <Router>
      <body>
        <header className={styles.App}>
          <NavBar />
          <HomePage/>
        </header>
        <Switch>
          <Route exact path="/">
          <Redirect to="/HomePage" />
          </Route>
        </Switch>
      </body>
      </Router>
    </>
  );
};

export default App;
